import styled from "styled-components";
// import { width } from "styled-system";


export const Card = styled.div`
  
    background-color:var(--grey-4);
    color:var(--grey-0);
    width: 752px;
    height: 50px; 
    &:hover{
        background-color:var(--grey-2);
    },         
    font:var(--button-medium-text);
    border: none;
    border-radius: 4px;
`;
